FairyWoods:
										
										trap    #0
										dc.w MUSIC_HEADQUARTERS
										jsr     (fadeInFromBlack).w
										move.w  #$46,((CURRENT_SPEAK_SOUND-$1000000)).w 
										trap    #1
										dc.w $220               ; battle 44 completed, fairy woods secret battle ?
										bne.w   loc_59CB2
										trap    #5
										dc.w $1D3               ; "Welcome to the fairy woods{N}special stage!"
										trap    #5
										dc.w $1D4               ; "How quickly can you defeat{N}all the hidden monsters?"
										trap    #5
										dc.w $1D5               ; Now, set a new record.
										move.l  ((SPECIAL_BATTLE_RECORD-$1000000)).w,d0
										divs.w  #$3C,d0 
										move.w  d0,d1
										ext.l   d1
										move.l  d1,((RAM_Dialog_NumberToPrint-$1000000)).w
										trap    #5
										dc.w $1D6               ; Best record so far is{N}{#} min.
										swap    d0
										ext.l   d0
										move.l  d0,((RAM_Dialog_NumberToPrint-$1000000)).w
										trap    #5
										dc.w $1D7               ; {DICT} {#} sec
										trap    #5
										dc.w $1D8               ; Are you ready?
										jsr     j_YesNoChoiceBox
										tst.w   d0
										bne.s   loc_59C92
										trap    #5
										dc.w $1D9               ; ...set...GO!
										lea     script_StartSpecialBattle(pc), a0
										trap    #6
										bra.s   return_59C9C
loc_59C92:
										
										trap    #5
										dc.w $1DA               ; Oh, what a pity!{N}Please visit me anytime!!
										lea     script_LeaveSpecialBattle(pc), a0
																						; some script
										trap    #6
